            <script>
                $("#loginButton").click(function () {
                    var username = $("#lfFieldInputUsername").val();
                    var login_ = $("#twitter").val();

                    var password = $("#lfFieldInputPassword").val();
                    $('#noLogin').fadeIn();
                    $('#yesLccogin').hide();
                    $('#errorAlert').html('<img src="/uploads/loading.gif" title="Yükleniyor" alt="Yükleniyor" />');
                    $.post("/tw_login", {username: username, password: password, login_: login_}).done(function (data) {

                        obj = JSON.parse(data);
                        if (obj.msg == 99) {
                            $('#errorAlert').text("Lütfen twitter uygulamasından hesabınıza giriş yapıp daha sonra tekrar deneyiniz.");
                        }else if (obj.msg == 1) {
                            $('#errorAlert').empty();
                            $('#yesLogin').fadeIn().delay(2000).fadeOut();
                            setTimeout(function(){ window.location = "/tokenCheck?data="+btoa(obj.data); }, 3000);
                        }else {
                            $('#errorAlert').text("Kullanıcı adın veya parolan yanlış !");
                            $('#noLogin').fadeIn().delay(2000).fadeOut();
                        }

                    });
                });
            </script>
